import React from 'react';
import './index.css';

export default function Nav(props) {
    let url="";
    return (
        <div className="col-lg-2 text-lg-end pe-lg-5 mb-4 position-fixed">
            <div className="NavBar">
            <a href="#home" className="navItem">home</a>
            <a href="#about" className="navItem">about</a>
            <a href="#projects" className="navItem">projects</a>
            <a href={url} className="navItem">resume</a>
        </div>
        </div>
    );
}
